import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';
import '../contents/css/header/header.css';

class Header extends Component {

  render () {

    const mainjsx = <NavLink class="navbar-brand" id="setColor" to="/a">SBRR-Crud</NavLink>;

    const homejsx = <NavLink class="nav-link" to="/" activeClassName='activeNav'>
    <i class="fa fa-home"></i> &nbsp;Home<span class="sr-only">(current)</span>
  </NavLink>;

    const addbookjsx =  <NavLink class="nav-link" to="/addbk" activeClassName='activeNav'>
    <i class="fas fa-save"></i> &nbsp;Add Book
  </NavLink>;

    const fetchbooksjsx = <NavLink class="nav-link" to="/xx" activeClassName='activeNav'>
    <i class="fas fa-archive"></i> &nbsp;Fetch Books
  </NavLink>;

    const updatebookjsx =  <NavLink class="nav-link" to="/xx" activeClassName='activeNav'>
    <i class="fas fa-edit"></i> &nbsp;Update Book
  </NavLink>;

    return (
      <div class="setting_navs">
      <nav class="navbar navbar-expand-sm bg-danger navbar-dark">
        {mainjsx}&nbsp;&nbsp;&nbsp;
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent"
          aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse navpad" id="navbarSupportedContent">
          <ul class="navbar-nav mr-auto">
            <li class="nav-item">
             {homejsx}
            </li>
            <li class="nav-item">
              {addbookjsx}
            </li>
            <li class="nav-item">
              {fetchbooksjsx}
            </li>
            <li class="nav-item">
              {updatebookjsx}
            </li>
          </ul>
        </div>
      </nav>
    </div>      
    );
  }
}
export default Header;
